// components/PredictedPrice.js
import React from 'react';

const PredictedPrice = ({ predictedPrice }) => {
    return (
        <div>
            {predictedPrice !== null ? (
                <p>Predicted Price: ${predictedPrice.toFixed(2)}</p>
            ) : (
                <p>Click 'Predict Price' to see the prediction</p>
            )}
        </div>
    );
};

export default PredictedPrice;
